import React from 'react';

const RankTable = (props) => {
    const {rankList} = props
    let showList = []
    rankList.forEach((rank) =>{
        let str = rank.username + " : " + rank.reactTime_Best
        showList.push(<li>str</li>)
    })


    return (
       <ol>
           {showList}
       </ol>
    )
};

export default RankTable
